import React, {useEffect} from 'react';
import '../static/css/Navbar.css';
import 'aos/dist/aos.css';
import Aos from 'aos';

function Navbar() {

  useEffect(() => {
    Aos.init({ duration: 2000 });
  }, []);

    return(
        <div className='navBar'>
          <ul className='navList'>
            <a href="#about" className="button" data-aos='slide-down' data-aos-delay='200'>About</a>
            <a href="#projects" className="button" data-aos='slide-down' data-aos-delay='400'>Projects</a>
            <a href="#contact" className="button" data-aos='slide-down' data-aos-delay='600'>Contact</a>
          </ul>
        </div>
    );

}


export default Navbar;
